var tipuesearch = {"pages": [{'title': '協同產品設計實習', 'text': '組員: 40823101 林晏鈴 、 40823104 葉沛翎 、 40823119 林郁凱 、 40823150 蘇鷺瑋 \n 組員個人網站: 40823101 、 40823104 、 40823112 、 40823150 \n 小組網站: GitHub 、 CMSIMDE \n stage1倉儲: ag4 、 ag11 \n stage1網站: ag4 、 ag11 \n \n \n', 'tags': '', 'url': '協同產品設計實習.html'}, {'title': 'Topic', 'text': '', 'tags': '', 'url': 'Topic.html'}, {'title': 'w5', 'text': '本周確定組別(stage2-ag4)以及組員(40823101、40823104、4023119、40823150)，並思考出大致的主題方向，這次主題將以腳踏車為主，也有可能再加入其他本組的構想，將再待觀察及提案。 \n 參考資料: http://www.bikefun.com.tw/m/405-1602-54117,c12798.php \n \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0\xa0 迪卡儂 \n \n \n', 'tags': '', 'url': 'w5.html'}, {'title': 'w6', 'text': '1.solvespace \n \xa0 \xa0 <1>下載 solvespace.exe \n \xa0 \xa0 <2>嘗試使用solvespace \n \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \n \n', 'tags': '', 'url': 'w6.html'}, {'title': 'w7', 'text': '利用INVENTER繪製出零件圖並組合。 \n \n', 'tags': '', 'url': 'w7.html'}, {'title': 'w8', 'text': '利用coppliasim製作模擬 \n 1.第一次模擬發現輪子和齒輪會直接掉落，經過從以前學長的影片和講解我們發現是基準面的問題 \n 2.所以我們增加了基準面，就有了第二個模擬 \n \n 3.，將踏板個後齒輪和後輪連結在一起，最後我們本來要進行實體碰撞，但是，發現我們進行實體碰撞之後齒輪方面會卡齒，我們更換了間隔更大的齒輪發現無法解決問題，導致自行車會散架，我們也無從到學長的影片和講解中得到解釋，所以我們的實體實驗失敗了 \n', 'tags': '', 'url': 'w8.html'}, {'title': '心得', 'text': '在這次大家的合作中，我們都能發揮處各位的特長，取其精華，同時組內氛圍良好，沒有出現爭吵，大家都按照自己應該做的事情好好完成，雖然結果沒有到達自己滿意的程度，但是我們都還是很滿足於過程，大家的討論和配合，非常體現出小組合作的重要性與，也能感受到，小組合作在自己不擅長的地方有其他組員的彌補變得更加方便和簡單，大家也能發揮自己擅長的地方去配合，這是一次很好的經歷和磨練！！', 'tags': '', 'url': '心得.html'}]};